import React from 'react';
import logo from './logo.svg';
import './App.css';

function One(){
  return <div> Hello world!</div>;
}

class App extends Component {
  render(){
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />


      </header>
      <One></One>
    </div>
  );
  }
}

export default App;
